Defendant Jose R Gonzalez Torres in court with attorney J Anthony Rosario.  Michael Thurston appeared for the State of Wisconsin.  Patrick Ryan appeared as interpreter, sworn in.  Amended information filed.  Defendant pleads guilty to count #1.  Court finds the defendant guilty of count #1.  Case #16CF347 is dismissed and read in.  State makes recommendations.  Attorney Rosario makes statements.  Defendant makes statements. 
The Court Orders the Following: Count #1.  
Imposed and Stayed Sentence of:
180 Days Huber with STANDARD RELEASE CONDITIONS.  (Credit - 2 days). 
Term of Probation: 1 Year may be transferred to Milwaukee County. 
Conditions of Probation:
Follow through with any treatment and/or counseling recommended by Agent;
AODA Assessment and follow through with any treatment recommended;
Absolute Sobriety; Random U.A.s;
No Use or Possession of illegal controlled substances or drug paraphernalia;
Perform  40 hours of community service each year of probation;
Condition Time: 10 days jail without work release STAYED to be used at the Agents discretion
COSTS:  $268.00 to be paid as a condition of probation
DNA Surcharge: $250.00 to be paid as a condition of probation
DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 
Felony warnings, immigration warnings, voting rights and firearms warnings given.
